import React from 'react';

const ContactsListItems = ({ name, id, number, deleteContact }) => {
  return (
    <li key={id} className="contact">
      <span>{name}</span>
      <span>{number}</span>
      <button type="button" id={id} onClick={e => deleteContact(e.target.id)}>
        x
      </button>
    </li>
  );
};
export default ContactsListItems;
